      "excerpt": "<h1 id=\"rari-capital-documentation\"><a class=\"header-anchor\" href=\"#rari-capital-documentation\">#</a> Rari Capital Documentation</h1>\n<h2 id=\"background\"><a class=\"header-anchor\" href=\"#background\">#</a> Background</h2>\n<p>The Rari Capital contributors are in pursuit of one goal: how to enable the most amount of people to earn the most amount of yield.</p>\n<p>The pursuit of this goal began with our yield aggregator. The yield aggregator was Rari Capital's first product and enables anyone to instantly deposit a supported crypto-asset into a pool for it to be continiously rebalanced for the highest yield.</p>\n<p>Then came along Fuse which began as a fork of Compound Finance but enabled anyone to spin up their own money markets. Additionally we have various other products in the pipeline: Nova and tanks just to mention a few. Have fun and good luck building as you explore the documentation! If you have any questions, feel free to ask in our Discord.</p>\n<h2 id=\"getting-started-from-scratch-hello\"><a class=\"header-anchor\" href=\"#getting-started-from-scratch-hello\">#</a> Getting Started from scratch hello</h2>\n<p>In this guide, you'll learn how to add default blog theme to a new project manually.</p>\n<h3 id=\"installation\"><a class=\"header-anchor\" href=\"#installation\">#</a> Installation</h3>\n<!--beforebegin--><div class=\"language-bash extra-class\"><!--afterbegin--><pre v-pre class=\"language-bash\"><code><span class=\"token function\">mkdir</span> blog <span class=\"token operator\">&amp;&amp;</span> <span class=\"token builtin class-name\">cd</span> blog <span class=\"token comment\"># Create an empty directory and go into it</span>\n\n<span class=\"token function\">yarn</span> <span class=\"token function\">add</span> vuepress @vuepress/theme-blog -D <span class=\"token comment\"># Install the dependencies</span>\n<span class=\"token comment\"># OR npm install vuepress @vuepress/theme-blog -D</span>\n</code></pre>\n<!--beforeend--></div><!--afterend--><h3 id=\"folder-structure\"><a class=\"header-anchor\" href=\"#folder-structure\">#</a> Folder structure</h3>\n<p>Here's the recommended project structure:</p>\n<!--beforebegin--><div class=\"language-bash extra-class\"><!--afterbegin--><pre v-pre class=\"language-bash\"><code>├── blog\n│   ├── _posts\n│   │   ├── <span class=\"token number\">2018</span>-11-7-frontmatter-in-vuepress.md <span class=\"token comment\">#example</span>\n│   │   ├── <span class=\"token number\">2019</span>-2-26-markdown-slot.md <span class=\"token comment\">#example</span>\n│   │   └── <span class=\"token number\">2019</span>-5-6-writing-a-vuepress-theme.md <span class=\"token comment\">#example</span>\n│   └── .vuepress\n│       ├── <span class=\"token variable\"><span class=\"token variable\">`</span>components<span class=\"token variable\">`</span></span> _<span class=\"token punctuation\">(</span>**Optional**<span class=\"token punctuation\">)</span>_\n│       ├── <span class=\"token variable\"><span class=\"token variable\">`</span>public<span class=\"token variable\">`</span></span> _<span class=\"token punctuation\">(</span>**Optional**<span class=\"token punctuation\">)</span>_\n│       ├── <span class=\"token variable\"><span class=\"token variable\">`</span>styles<span class=\"token variable\">`</span></span> _<span class=\"token punctuation\">(</span>**Optional**<span class=\"token punctuation\">)</span>_\n│       │   ├── index.styl\n│       │   └── palette.styl\n│       ├── config.js\n│       └── <span class=\"token variable\"><span class=\"token variable\">`</span>enhanceApp.js<span class=\"token variable\">`</span></span> _<span class=\"token punctuation\">(</span>**Optional**<span class=\"token punctuation\">)</span>_\n└── package.json\n</code></pre>\n<!--beforeend--></div><!--afterend--><p><strong>Required</strong>:</p>\n<ul>\n<li><code>blog/.vuepress/config.js</code>: Entry file of configuration, can also be <code>yml</code> or <code>toml</code>.</li>\n<li><code>blog/_posts</code>: Stores your post content.</li>\n</ul>\n<p><strong>Optional</strong>:</p>\n<p>If you wish to configure the files below, you'll need some knowledge of <a href=\"https://vuepress.vuejs.org/\" target=\"_blank\" rel=\"noopener noreferrer\">VuePress<OutboundLink/></a>.</p>\n<ul>\n<li><code>blog/.vuepress/components</code>: The Vue components in this directory will be automatically registered as global components.</li>\n<li><code>blog/.vuepress/styles</code>: Stores style related files.</li>\n<li><code>blog/.vuepress/styles/index.styl</code>: Automatically applied global style files, generated at the ending of the CSS file, have a higher priority than the default style.</li>\n<li><code>blog/.vuepress/styles/palette.styl</code>: The palette is used to override the default color constants and to set the color constants of Stylus.</li>\n<li><code>blog/.vuepress/public</code>: Static resource directory.</li>\n<li><code>blog/.vuepress/enhanceApp.js</code>: App level enhancement.</li>\n</ul>\n<h3 id=\"using-vuepress-theme-blog\"><a class=\"header-anchor\" href=\"#using-vuepress-theme-blog\">#</a> Using @vuepress/theme-blog</h3>\n<p>You must add <code>@vuepress/theme-blog</code> as a theme in <code>.vuepress/config.js</code>. <code>@vuepress/theme-blog</code> is configurable, but we will use the defaults for now.</p>\n<!--beforebegin--><div class=\"language-js extra-class\"><!--afterbegin--><pre v-pre class=\"language-js\"><code><span class=\"token comment\">// .vuepress/config.js</span>\nmodule<span class=\"token punctuation\">.</span>exports <span class=\"token operator\">=</span> <span class=\"token punctuation\">{</span>\n  title<span class=\"token operator\">:</span> <span class=\"token string\">'VuePress Blog Example'</span><span class=\"token punctuation\">,</span> <span class=\"token comment\">// Title for the site. This will be displayed in the navbar.</span>\n  theme<span class=\"token operator\">:</span> <span class=\"token string\">'@vuepress/theme-blog'</span><span class=\"token punctuation\">,</span>\n  themeConfig<span class=\"token operator\">:</span> <span class=\"token punctuation\">{</span>\n    <span class=\"token comment\">// Please keep looking down to see the available options.</span>\n  <span class=\"token punctuation\">}</span>\n<span class=\"token punctuation\">}</span>\n</code></pre>\n<!--beforeend--></div><!--afterend--><p>Add the scripts to package.json file:</p>\n<!--beforebegin--><div class=\"language-json extra-class\"><!--afterbegin--><pre v-pre class=\"language-json\"><code><span class=\"token comment\">// package.json</span>\n<span class=\"token punctuation\">{</span>\n  ...\n  <span class=\"token property\">\"scripts\"</span><span class=\"token operator\">:</span> <span class=\"token punctuation\">{</span>\n    ...\n    <span class=\"token property\">\"dev\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"vuepress dev blog\"</span><span class=\"token punctuation\">,</span> <span class=\"token comment\">// starts a development server with automatic reload.</span>\n    <span class=\"token property\">\"build\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"vuepress build blog\"</span> <span class=\"token comment\">// builds your website.</span>\n  <span class=\"token punctuation\">}</span>\n  ...\n<span class=\"token punctuation\">}</span>\n</code></pre>\n<!--beforeend--></div><!--afterend--><p>From now on, you can run <code>yarn dev</code> or <code>npm run dev</code> and head <code>localhost:8080</code> to see your blog!</p>\n<h3 id=\"generating-content\"><a class=\"header-anchor\" href=\"#generating-content\">#</a> Generating content</h3>\n<p>The <code>_posts</code> folder is where your blog posts live. You can simply write blog posts in Markdown.</p>\n<p>All blog post files can begin with front matter. Only <code>title</code> is required, but we recommend you define all frontmatter variables as below. They'll be used to set the corresponding layout. Check out <a href=\"config/front-matter\">frontmatter</a> for more details. Here's an example:</p>\n<!--beforebegin--><div class=\"language-md extra-class\"><!--afterbegin--><pre v-pre class=\"language-md\"><code><span class=\"token front-matter-block\"><span class=\"token punctuation\">---</span>\n<span class=\"token font-matter yaml language-yaml\">title: Hello World\ndate: 2020-01-11\nauthor: Billyyyyy3320\nlocation: Taipei</span>  \n<span class=\"token punctuation\">---</span></span>\n\n<span class=\"token blockquote punctuation\">></span> This is official blog theme.\n\nMy content.\n</code></pre>\n<!--beforeend--></div><!--afterend--><p>You can name your post files anything you like but we recommend including the date at the front.\nIt helps you organize and will be use as permalink by default. For example:</p>\n<!--beforebegin--><div class=\"language- extra-class\"><!--afterbegin--><pre v-pre class=\"language-text\"><code>2018-11-7-frontmatter-in-vuepress.md \n2019-2-26-markdown-slot.md \n2019-5-6-writing-a-vuepress-theme.md \n</code></pre>\n<!--beforeend--></div><!--afterend--><h3 id=\"blog-tags\"><a class=\"header-anchor\" href=\"#blog-tags\">#</a> Blog tags</h3>\n<p>By default, Navigate to <code>/tag/</code>, you'll see the tag entry page.\nYou can set you own tags in front matter, and they'll automatically be classified:</p>\n<!--beforebegin--><div class=\"language-yaml extra-class\"><!--afterbegin--><div class=\"highlight-lines\"><br><br><br><div class=\"highlighted\">&nbsp;</div><div class=\"highlighted\">&nbsp;</div><div class=\"highlighted\">&nbsp;</div><br><br><br><br></div><pre v-pre class=\"language-yaml\"><code><span class=\"token punctuation\">---</span>\n<span class=\"token key atrule\">title</span><span class=\"token punctuation\">:</span> Hello World\n<span class=\"token key atrule\">date</span><span class=\"token punctuation\">:</span> <span class=\"token datetime number\">2020-01-11</span>\n<span class=\"token key atrule\">tags</span><span class=\"token punctuation\">:</span> \n  <span class=\"token punctuation\">-</span> JavaScript\n  <span class=\"token punctuation\">-</span> Vue\n<span class=\"token key atrule\">author</span><span class=\"token punctuation\">:</span> Billyyyyy3320\n<span class=\"token key atrule\">location</span><span class=\"token punctuation\">:</span> Taipei  \n<span class=\"token punctuation\">---</span>\n</code></pre><!--beforeend--></div><!--afterend--><h3 id=\"summary\"><a class=\"header-anchor\" href=\"#summary\">#</a> Summary</h3>\n<p>By default, summary will be extracted from source markdowns. If you need to override it, we present the following two approaches:</p>\n<ol>\n<li>\n<p><RouterLink to=\"/front-matter.html#summary\">Writing the summary manually in frontmatter</RouterLink></p>\n</li>\n<li>\n<p>[Setting up excerpt separator by writing a comment `</p>\n</li>\n</ol>\n"
